        /// <summary>
        /// [網路解] 加總法
        /// </summary>
        /// <param name="s"></param>
        /// <returns></returns>
        public int NiceLengthOfLongestSubstring(string s)
        {
            _count = 0;
            var NO_OF_CHARS = 256;
            var table = new int[NO_OF_CHARS];
            for (var i = 0; i < NO_OF_CHARS; i++)
            {
                table[i] = -1;
            }

            int prev_index;
            var max = 0;
            var currentLength = 0;
            for (var i = 0; i < s.Length; i++)
            {
                _count++;
                prev_index = table[s[i]];
                var currentCharDistance = i - prev_index;
                if (prev_index == -1 || currentLength < currentCharDistance)
                    currentLength++;
                else
                {
                    if (currentLength > max)
                        max = currentLength;

                    currentLength = currentCharDistance;
                }

                table[s[i]] = i;
            }

            if (currentLength > max)
                max = currentLength;

            return max;
        }

        /// <summary>
        /// [自解] 分段解 
        /// </summary>
        /// <param name="s"></param>
        /// <returns></returns>
        public int LengthOfLongestSubstring(string s)
        {
            _count = 0;
            var start = 0;
            var temp = new char[0][];
            int index = 0;
            int itemIndex;
            do
            {
                Array.Resize(ref temp, temp.Length + 1);
                temp[index] = new char[0];
                itemIndex = 0;
                for (var i = start; i < s.Length; i++)
                {
                    _count++;
                    if (!temp[index].Contains(s[i]))
                    {
                        Array.Resize(ref temp[index], temp[index].Length + 1);
                        temp[index][itemIndex] = s[i];
                        itemIndex++;
                    }
                    else
                        break;
                }

                start += temp[index].Length;
                index++;
            } while (start < s.Length);

            var result = 0;
            for (var i = 0; i < temp.Length - 1; i++)
            {
                var no = this.GetResult(temp[i], temp[i + 1]);
                result = no > result ? no : result;
            }

            return result > 0 ? result : s.Length;
        }

        private int GetResult(char[] a, char[] b)
        {
            var max = Math.Max(a.Length, b.Length);
            var alist = a.ToList();
            var blist = b.ToList();
            var i = 0;

            do
            {
                _count++;
                if (alist.Contains(blist[i]))
                {
                    var side = alist.IndexOf(blist[i]) + 1;
                    var ben = blist.Count - i;
                    if (ben >= side)
                    {
                        alist.RemoveRange(0, side);
                        alist.Add(blist[i]);
                        blist.RemoveRange(0, i + 1);
                        i = 0;
                    }
                    else
                    {
                        break;
                    }
                }
                else
                {
                    alist.Add(blist[i]);
                    i++;
                }

                max = Math.Max(max, alist.Count);
            } while (i < blist.Count);

            return max;
        }

