        /// [自解] 暴力解 O(N!)
        /// </summary>
        /// <param name="s"></param>
        /// <returns></returns>
        public int LengthOfLongestSubstring1(string s)
        {
            var start = 0;
            var result = 0;
            int index;
            do
            {
                index = 0;
                var temp = new char[0];
                for (var i = start; i < s.Length; i++)
                {
                    _count++;
                    if (!temp.Contains(s[i]))
                    {
                        Array.Resize(ref temp, temp.Length + 1);
                        temp[index] = s[i];
                        index++;
                    }
                    else
                        break;
                }

                if (temp.Length > result)
                    result = temp.Length;

                start++;
            } while (start < s.Length);

            return result;
        }
